This change is also likely to break clients, considering we're changing behavior, and I'm really hesitant to break that unless we've actually broken the spec here.  If it were just additive, that would be one thing, but as-is, it's completely moving a key that clients might be looking for.

I also have suspicions that the per-key value in the errors field here isn't allowed.  Prior to this work, did you engage with Redfish, or any of the Redfish experts on your team (Gunnar comes to mind) to determine that this was the right course to go down.

